window.bookSummaryJSON = "<p>This seminal text in the history of moral philosophy elaborates the basic themes of Kant's moral theory, gives the most complete statement of his highly original theory of freedom of the will, and develops his practical metaphysics. This new edition, prepared by an acclaimed translator and scholar of Kant's practical philosophy, presents the first new translation of the work to appear for many years, together with a substantial and lucid introduction.</p>"; 
